Description
Kiara Mia, Veronica Avluv, Yuri Luv, Allison Moore, Andy San Dimas, Lexington Steele, Flash Brown, Seth Gamble, Richie Calhoun, John Johnson

Kiara Mia is youthful, sensual, sexual starlet whose fame arose from a sex tape release with a former hot artist Ray (John Johnson). Kiara Mia has also skyrocketed her two sisters Court (Yuri Beltran) and Chloe (Allison Moore) along side her for the stargazing ride. Meanwhile their mother Kris (Veronica Avluv) manages Kiara Mia while balancing the rest of the household
